import React from 'react';
import HomePage from "./pages/homepage/HomePage";
import './App.css'

import {
  Switch,
  Route,
  Link
} from "react-router-dom";
import X from './pages/detail/x';

const App = () => {
  return (

    <div className="App">

      <div><Link to="/about/aValue">Dashboard</Link></div>

      <Switch>
        <Route exact path="/">
          <HomePage />
        </Route>
        <Route path="/about/:Aparam">
          <X />
        </Route>
      </Switch>

    </div>


  );
};

export default App;
